nil.isNil_ = function(x) {
	switch(typeof x) {
		case "undefined":
			return true;
		case "string": case "boolean":
		case "number": case "function":
			return false;
	};
	if ((x===null) || (x === this)) return true;
	if (x===smalltalk) return false;
	if ((x.$klass) && ("function" === typeof x.isNil)) return x.isNil();
	return false;
}
